import React from 'react';
import './styles/AboutUs.css'
import Logoo from './styles/Images/Logo.png'


const AboutUsPage = () => {
    return (

        <section className="aboutUsPage">
            <img src={Logoo}/>
        </section>

    );

};

export default AboutUsPage;
